function preload() {
  //http://icons.iconarchive.com/icons/goodstuff-no-nonsense/free-space/128/space-ship-2-icon.png
  sand = loadImage("data:image/png;base64,");
  rover = loadImage("data:image/png;base64,");
  //http://agavaceae.info//2018/mars-clipart-background/mars-clipart-background-1.jpg
  //background = loadImage("");
}

function setup() {
  createCanvas(windowWidth,windowHeight-(windowHeight/5));
  x = windowWidth/2;
  y = windowHeight/2;
}

function keyBoard() {
  if(keyIsDown(UP_ARROW)) {
    mov("F",0.5);
  } else if(keyIsDown(DOWN_ARROW)) {
    mov("B",0.5);
  } else if(keyIsDown(LEFT_ARROW)) {
    trn("L");
  } else if(keyIsDown(RIGHT_ARROW)) {
    trn("R");
  }
}

function draw() {
  background("rgba(255,255,255,0)");
  fill("#000000");
  clear();
  image(sand,sandX,height/2);
  translate(x,y);
  sandX = sandX>width?-500:++sandX;
  rotate(radians(axis));
  imageMode(CENTER);
  image(rover,0,0,50,60);
  $("#stats").html(" <b>X:</b> "+x+"<br> <b>Y:</b> "+y+"<br> <b>Rotation:</b> "+axis+"&deg;<br><b>Container:</b> "+container.length+"/5<br> <b>Camera memory:</b> "+gallery.length+"/10");
  if(width<x) {
    x = width;
  } else if(x<0) {
    x = 0;
  } else if(y>height) {
    y = height;
  } else if(y<0) {
    y = 0;
  }
  keyBoard();
}



function mov(dir,step) {
  logData += hour()+":"+minute()+":"+second()+"  <b>MOV "+dir+" "+step+"</b><br>";
  axis = axis>=360?axis-360:axis<0?360+axis:axis;
  if(isNaN(step)) {
    $.notify("Error",{
      style: "err",
      position: "left top",
    });
    $("#console").append("<span style='color:red'>TRN got a non-number as steps. Execution stopped</span>")
  } else if(axis==0) {
    y += dir=="F"?-step*10:step*10;
  } else if(axis>0&&axis<90) {
    y += dir=="F"?-step*10:step*10;
    x += dir=="F"?10:-10;
  } else if(axis==90) {
    x += dir=="F"?step*10:-step*10;
  } else if(axis>90&&axis<180) {
    y += dir=="F"?step*10:-step*10;
    x += dir=="F"?10:-10;
  } else if(axis==180) {
    y += dir=="F"?step*10:-step*10;
  } else if(axis>180&&axis<270) {
    y += dir=="F"?step*10:-step*10;
    x += dir=="F"?-10:10;
  } else if(axis==270) {
    x += dir=="F"?-10:10;
  } else if(axis>270&&axis<360) {
    y += dir=="F"?-step*10:step*10;
    x += dir=="F"?-10:10;
  }
}

function trn(dir) {
  logData += hour()+":"+minute()+":"+second()+"  <b>TRN "+dir+"</b><br>";
  axis += dir=="L"?-15:15
}

function rck() {
  if(container.length < 5) {
    logData += hour()+":"+minute()+":"+second()+"  <b>RCK</b><br>";
    index = container.push(rocks[getRandomInt(0,rocks.length-1)]);
    $.notify("RCK+",{
      style: "ok",
      position: "left top",
    });
    $("#console").append("Successfully collected a rock. (Container: "+container.length+"/5)<br>");
    $(".rmv-ico").remove();
    $("#box"+(index)).html("<img style='height: 90%' src='"+container[index-1][1]+"' alt='"+container[index-1][0]+"'><div class='rock-info'>"+container[index-1][0]+"</div><i class='btn btn-sm far fa-trash-alt rmv-ico' onclick='rls()'></i>");
  } else {
    $.notify("Warning",{
      style: "warn",
      position: "left top",
    });
    $("#console").append("<span style='color:#FF9800'>Unable to execute RCK: Container full (5/5)</span><br>");
    newCmd();
  }
}

function rls() {
  if(container.length > 0) {
    logData += hour()+":"+minute()+":"+second()+"  <b>RLS</b><br>";
    $("#box"+container.length).html("EMPTY");
    container.pop();
    $("#box"+(container.length)).html(container.length==0?"EMPTY":"<img style='height: 90%' src='"+container[container.length-1][1]+"' alt='"+container[container.length-1][0]+"'><div class='rock-info'>"+container[container.length-1][0]+"</div><i class='btn btn-sm far fa-trash-alt rmv-ico' onclick='rls()'></i>");
    $("#console").append("Successfully released a rock! (Container: "+container.length+"/5)<br>");
    $.notify("RLS-",{
      style: "ok",
      position: "left top",
    });
  } else {
    $.notify("Warning",{
      style: "warn",
      position: "left top",
    });
    $("#console").append("<span style='color:#FF9800'>Unable to execute RLS: Container is already empty (0/5)</span><br>");
    newCmd();
  }
}

