//$("#console").append("");
function hlp(args) {
  newCmd();
  if(args.length==1) {
    $("#console").append("<b>HLP:</b> Displays this help message<br><b>MOV [dir] [step]: </b> Moves the rover by the specific steps in the specific direction<br><b>TRN [dir]:</b> Turns the rover to the specific direction by 15&deg;<br><b>RCK: </b>Collects a sample of rock<br><b>RLS: </b>Releases the last collected rock<br><b>ANL: </b>Performs a chemical analysis on t he last collected rock.<br><b>PIC: </b>Takes a photograph of the rover and the surrounding<br><b>PIC S: </b>Takes a photograph of the surrounding.<br><b>LOG: </b> Prints the executed commands<br>");
  } else {
    let cmd = args[1];
    if(cmd=="MOV") {
      $("#console").append("Syntax: MOV [dir] [step]<br>Moves the rover in the specific direction ('F'/,'B') by the specified number of steps.<br>");
    } else if(cmd=="TRN") {
      $("#console").append("Syntax: TRN [dir]<br>Turns the rover to the specified direction ('L'/'R') by 15&deg;<br>");
    } else if(cmd=="RCK") {
      $("#console").append("Syntax: RCK<br>Collects a sample of rock.<br>");
    } else if(cmd=="RLS") {
      $("#console").append("Syntax: RLS<br>Releases the last collected rock<br>");
    } else if(cmd=="ANL") {
      $("#console").append("Syntax: ANL<br>Performs a chemical analysis on the last collected rock<br>");
    } else if(cmd=="PIC") {
      $("#console").append("Syntax: PIC &lt;S&gt;<br>Arguments: S<br>Takes a picture of the rover and the surrounding. If argument S is provided then it will take an image of the sky.<br>");
    } else if(cmd=="LOG") {
      $("#console").append("Syntax: HLP<br>Displays a list of executed commands<br>");
    } else if(cmd=="HLP") {
      $("#console").append("Syntax: HLP <Command-name><br>HLP displays a list of executable commands. If Command-name argument is provided then it will display information about it.<br>");
    } else {
      $("#console").append("<span style='color:red'>Command not found. Try HLP to see a list of available commands. </span><br>");
    }
  }
}

function newCmd(){
      $("#console>.cmd").remove();
      $("#console").append("<div class='cmd'>$ <input type='text' autofocus><button onclick=\"javascript:void(onCmd($('input').val()))\">Submit</button></div>");
      $("#console").scrollTop($("#console").prop("scrollHeight"));
      $("#manual").hide();
      $("#console").show();
}

function _log_() {
  $("#console").append(logData);
  newCmd();
}

//thanks to stackoverflow and MDN
function getRandomInt(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min + 1)) + min;
}

function onCmd(cmd) {
  cmd = cmd.toUpperCase().replace(/\s+/gi," ");
  $("#console>.cmd").remove();
  $("#console").append("<br>$ "+cmd+"<br>");
  if(cmd.substring(0,3)=="MOV") {
    if(cmd.split(" ").length!=3) {
      $("#console").append("<span style='color:red'>MOV needs 3 parameters. Found: "+cmd.split(" ").length+" Execution stopped </span><br>");
      $.notify("Error",{
        style: "err",
        position: "left top",
      });
    } else {
        mov(cmd.split(" ")[1],cmd.split(" ")[2]);
        $("#console").append("<br>Successfully moved");
  }
  } else if(cmd.substring(0,3)=="TRN") {
    if(cmd.split(" ").length!=2) {
      $("#console").append("<span style='color:red'>TRN needs 2 parameters. Found: "+cmd.split(" ").length+" Execution stopped </span><br>");
      $.notify("Error",{
        style: "err",
        position: "left top",
      });
    } else {
        trn(cmd.split(" ")[1]);
        $("#console").append("<br>Successfully turned");
    }
  } else if(cmd=="LOG") {
    _log_();
  } else if(cmd=="RCK") {
      rck();
  } else if(cmd=="RLS") {
      rls();
  } else if(cmd=="ANL") {
      anl();
  } else if(cmd=="PIC") {
      pic();
  } else if(cmd=="PIC S") {
      picS();
  } else if(cmd.substring(0,3)=="HLP") {
      hlp(cmd.split(" "));
  } else {
    $("#console").append("<span style='color:red'>\'"+cmd+"\' is not a recognized command. Try HLP to see a list of available commands.</span><br>");
  }
  //finally
newCmd();

}
